r 5 minutes. The energy supplied is used to completely melt 160g of a solid at its melting point. Calculate the specific latent heat of the solid.\", \"options\": [{\"file\": \"\", \"text\": \"2.81 Jg\"}, {\"file\": \"\", \"text\": \"6.25 Jg\"}, {\"file\": \"\", \"text\": \"8.89 Jg\"}, {\"file\": \"\", \"text\": \"168.75 Jg\"}], \"embeddedMedia\": null}, \"response\": \"168.75 Jg\", \"attempted\": true, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"2dc11be1-78f9-4102-b78c-ec514cda95c6\", \"questionNum\": 3, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"answer\": \"0.25kg\", \"current\": false, \"question\": {\"id\": \"4a6311e7-959c-47c4-b1e1-fb120977eee6\", \"type\": \"MultipleChoice\", \"content\": \"1kg of boiling water at 100C is poured into an aluminium hot water bottle at 16C. The temperature of the water quickly falls to 96C. Assuming that there is no loss of heat, the mass of the bottle is\", \"options\": [{\"file\": \"\", \"text\": \"0.25kg\"}, {\"file\": \"\", \"text\": \"0.5kg\"}, {\"file\": \"\", \"text\": \"0.05kg\"}, {\"file\": \"\", \"text\": \"0.75kg\"}], \"embeddedMedia\": null}, \"response\": \"0.25kg\", \"attempted\": true, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"4a6311e7-959c-47c4-b1e1-fb120977eee6\", \"questionNum\": 4, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"answer\": \"The steam is at a higher temperature than the water\", \"current\": false, \"question\": {\"id\": \"2423bc7f-6c71-44fe-98f6-d2e3eaf23872\", \"type\": \"MultipleChoice\", \"content\": \"Steam from boiling water causes more damage on the skin than boiling water because\", \"options\": [{\"file\": \"\", \"text\": \"The steam is at a higher temperature than the water\"}, {\"file\": \"\", \"t