ection\": 40}, {\"answer\": \"1.3m\", \"current\": false, \"question\": {\"id\": \"23d89aaf-f975-4de1-a53e-fa26049daa48\", \"type\": \"MultipleChoice\", \"content\": \"An object is moving with a velocity of 5ms. At what height must a similar body be situated to have a potential energy equal in value with the kinetic energy of the moving body? [g  10ms]\", \"options\": [{\"file\": \"\", \"text\": \"1.3m\"}, {\"file\": \"\", \"text\": \"25.0m\"}, {\"file\": \"\", \"text\": \"1.0m\"}, {\"file\": \"\", \"text\": \"20.0m\"}], \"embeddedMedia\": null}, \"response\": \"1.3m\", \"attempted\": true, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"23d89aaf-f975-4de1-a53e-fa26049daa48\", \"questionNum\": 10, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"current\": false, \"question\": {\"id\": \"324eba5e-5291-4c2d-9536-0437269cb7f4\", \"type\": \"MultipleChoice\", \"content\": \"A piece of cork floats in a liquid. What fraction of its volume will be immersed in the liquid? [density of the cork = 0.25  10 kgm, Density of the liquid = 1.25  10 kgm]\", \"options\": [{\"file\": \"\", \"text\": \"0.2\"}, {\"file\": \"\", \"text\": \"0.1\"}, {\"file\": \"\", \"text\": \"0.8\"}, {\"file\": \"\", \"text\": \"0.5\"}], \"embeddedMedia\": null}, \"attempted\": false, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"324eba5e-5291-4c2d-9536-0437269cb7f4\", \"questionNum\": 11, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"answer\": \"iii only\", \"current\": false, \"question\": {\"id\": \"7916e505-c98d-4f4a-a786-87748f94f1ff\", \"type\": \"MultipleChoice\", \"content\": \"Which of the following remains unchanged as light travels from one Moderate to the other?\", \"options\": [{\"file\": \"\", \"text\": \"i only\