 a uniform magnetic field of flux density 5.010T. Calculate the force on the charge.\", \"options\": [{\"file\": \"\", \"text\": \"5.010N\"}, {\"file\": \"\", \"text\": \"5.010N\"}, {\"file\": \"\", \"text\": \"5.010N\"}, {\"file\": \"\", \"text\": \"5.010N\"}], \"embeddedMedia\": null}, \"response\": \"5.010N\", \"attempted\": true, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"66ea6bde-8fa6-4ceb-9bbd-df665f9325d6\", \"questionNum\": 19, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"current\": false, \"question\": {\"id\": \"3cbd9079-4c8d-48e3-9cd6-543f6ee56c9c\", \"type\": \"MultipleChoice\", \"content\": \"Two liquids X and Y having the same mass are supplied with the same quantity of heat. If the temperature rise in X is twice that of Y, the ratio of specific heat capacity of X to that of Y is\", \"options\": [{\"file\": \"\", \"text\": \"2 : 1\"}, {\"file\": \"\", \"text\": \"1 : 4\"}, {\"file\": \"\", \"text\": \"1 : 2\"}, {\"file\": \"\", \"text\": \"4 : 1\"}], \"embeddedMedia\": null}, \"attempted\": false, \"sectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"questionId\": \"3cbd9079-4c8d-48e3-9cd6-543f6ee56c9c\", \"questionNum\": 20, \"currentSectionId\": \"d8829d6c-6a0d-49ab-83f3-c97cbff1a279\", \"lastExamQuestion\": false, \"firstExamQuestion\": false, \"totalQuestionsInSection\": 40}, {\"answer\": \"57.7N\", \"current\": false, \"question\": {\"id\": \"a6459f5e-18b2-4784-9115-ad4b837c1d0c\", \"type\": \"MultipleChoice\", \"content\": \"The resultant of two forces is 50N. If the forces are perpendicular to each other and one of them makes an angle of 30 with the resultant, find its magnitude.\", \"options\": [{\"file\": \"\", \"text\": \"57.7N\"}, {\"file\": \"\", \"text\": \"25.0N\"}, {\"file\": \"\", \"text\": \"100.0N\"}, {\"file\": \"\", \"text\": \"43.3N\"}], \"embeddedMedia\": null}, \"response\": \"57.