('1a7b79cb-877d-4453-8d66-569944e85950', 'What determines the polarity at the ends of an electromagnet?', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Magnitude of the current passing through the wire\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Material of the core of the magnet\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Material of the coil\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Direction of current in the wire\", \"isCorrect\": true}]', 'Direction of current in the wire', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 1, 'Easy'),
('e6e17a91-8c5e-46ad-914e-cbaefffc9738', 'How many beta particle(s) are emitted in the radioactive decay of 79Au  80Hg?', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"1\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"2\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"3\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"5\", \"isCorrect\": false}]', '1', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 2, 'Easy'),
('2d7a035c-9c5e-4bd8-991a-7fcfe3eab6fc', 'The phenomenon by which two light atomic nuclei combine to form a heavy nuclide with the release of energy is known as', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Radioactivity\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Nuclear fusion\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Nuclear fission\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Chain reaction\", \"isCorrect\": false}]', 'Nuclear fusion', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 3, 'Easy'),
('4b58808f-d649-41ed-83e3-fbc5ec321639', 'In a p-type semiconductor, the', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Number of holes are equal to the number of electrons\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Electrical resistivity increases\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Electrons are the majority charge carriers\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Holes are the majority charge carriers\", \"isCorrect\": true}]', 'Holes are the majority charge carriers', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 4, 'Easy'),
('8be9cd14-cec5-466a-bb39-024fbba7e837', 'Let x be the uncertainty in the measurements of position and p the uncertainty in measurement of momentum. The uncertainty principle relation is given as', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"x . p = h\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"x . p  h\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"x . p  h\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"x . p > h\", \"isCorrect\": false}]', 'x . p  h', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 5, 'Hard'),
('2fa6ea46-edef-40fc-bbea-2d23ee25024c', 'Two objects of masses 80kg and 50kg are separated by a distance of 0.2m. If the gravitational constant is 6.6 x 10 Nm/kg, calculate the gravitational attraction between them.', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"4.9  10 N\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"1.3  10 N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"6.6  10 N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"6.6  10 N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"2.6  10 N\", \"isCorrect\": false}]', '4.9  10 N', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 6, 'Easy'),
('4a6311e7-959c-47c4-b1e1-fb120977eee6', '1kg of boiling water at 100C is poured into an aluminium hot water bottle at 16C. The temperature of the water quickly falls to 96C. Assuming that there is no loss of heat, the mass of the bottle is', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"0.25kg\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"0.5kg\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"0.05kg\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"0.75kg\", \"isCorrect\": false}]', '0.5kg', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 7, 'Easy'),
('a6459f5e-18b2-4784-9115-ad4b837c1d0c', 'The resultant of two forces is 50N. If the forces are perpendicular to each other and one of them makes an angle of 30 with the resultant, find its magnitude.', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"57.7N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"25.0N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"100.0N\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"43.3N\", \"isCorrect\": true}]', '43.3N', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 8, 'Easy'),
('9e1cc921-e0df-4760-817a-cc9192e0e474', 'Which of the following is stored by dry Leclanche cell?', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Chemical energy\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Nuclear energy\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Solar energy\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Electrical energy\", \"isCorrect\": false}]', 'Chemical energy', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 9, 'Easy'),
('8cafe26b-a3da-47f9-bc4b-c7e768d7f323', 'When a brick is taken from the earth\'s surface to the moon, its mass', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Remains constant\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Becomes zero\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Reduces\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Increases\", \"isCorrect\": false}]', 'Remains constant', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 10, 'Easy'),
('1e6c282e-731a-4ea7-a79a-655136e6531d', 'The pair of physical quantities that are scalar only are', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Volume and area\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Impulse and time\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Moment and momentum\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Length and displacement\", \"isCorrect\": false}]', 'Volume and area', NULL, NULL, '8ff15517-7afc-4315-ac7a-894ed8993659', '2025-06-01 02:29:06', '2025-06-01 02:29:06', 11, 'Easy'),
