('1d160d7e-945b-431e-a1d6-d2dd2a276c13', 'In the enzyme (amylase) reactions of starch, sugar starch is referred to as the', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Substrate\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Product\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Enzyme\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Enzyme-substrate complex\", \"isCorrect\": false}]', 'Substrate', NULL, NULL, '5404a146-1813-4aae-b7ae-585eda2d060d', '2025-07-27 11:53:26', '2025-07-27 11:53:26', 133, 'Easy'),
