('40db75dc-9d89-4137-9471-5fa9fc00157b', 'In man, identical twins occur when', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"An ovum is fertilized by a sperm and then divide into two, each forming a separate embryo\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"An ovum fertilized by two sperms and then divides into two, each forming an embryo\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Two ova are fertilized at the same time, each forming an embryo\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Two ova are fertilized by a single sperm each forming an embryo after fertilization\", \"isCorrect\": false}]', 'An ovum is fertilized by a sperm and then divide into two, each forming a separate embryo', NULL, NULL, '5404a146-1813-4aae-b7ae-585eda2d060d', '2025-07-27 11:53:26', '2025-07-27 11:53:26', 135, 'Easy'),
