('e921798c-0355-45b1-b1aa-2c1c5bd7a8ef', 'Which of these statements is NOT true of insects?', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"They are arthropods\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Their body is divided into three distinct regions of head, thorax, and abdomen\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Their thorax comprises three segments, only two of which bear a pair of appendages each\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Respiration is by means of trachea\", \"isCorrect\": false}]', 'Their thorax comprises three segments, only two of which bear a pair of appendages each', NULL, NULL, '5404a146-1813-4aae-b7ae-585eda2d060d', '2025-07-27 11:53:26', '2025-07-27 11:53:26', 137, 'Easy'),
('6e7ab074-ae86-47ac-8a19-86519f270e18', 'When an operculate fish breathes it takes in water through the', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Mouth and passes it out through the same way\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Mouth and passes it out through the operculum\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"Operculum and passes it out through the mouth\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Operculum and passes it out through the nostrils\", \"isCorrect\": false}]', 'Mouth and passes it out through the operculum', NULL, NULL, '5404a146-1813-4aae-b7ae-585eda2d060d', '2025-07-27 11:53:26', '2025-07-27 11:53:26', 138, 'Easy'),
