('801d2cfc-8342-4d0a-8816-4b8b4a46dcf9', 'A blue-green alga is not a prokaryote because', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"it is aquatic\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"its cells are prokaryotic\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"it cannot move\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"it is not a green plant\", \"isCorrect\": false}]', 'its cells are prokaryotic', NULL, NULL, '34df7e36-497a-4299-9ae3-05ae6700f8a6', '2025-07-27 16:02:13', '2025-07-27 16:02:13', 5, 'Moderate'),
