('8c6fb54f-3ad5-49c1-a41d-5cab887c4df9', 'In lizards, the lowering of the gular fold is used to', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"catch insects\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"attract mates\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"defend their territory\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"frighten enemies\", \"isCorrect\": false}]', 'attract mates', NULL, NULL, '34df7e36-497a-4299-9ae3-05ae6700f8a6', '2025-07-27 16:02:13', '2025-07-27 16:02:13', 18, 'Moderate'),
