('c2f82a84-0cf7-4378-8b3f-db7453140fdb', 'The tips of some rice seedlings were cut off while some were left intact. Both were covered with a container which had only one small hole to allow light through. After twenty-four hours it was observed that', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"The cut tips were bent away from the light\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"The cut tips bent towards the source of light\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"The intact tips bent away from the light\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"The intact tips bent towards the light\", \"isCorrect\": false}]', 'The cut tips bent towards the source of light', NULL, NULL, '34df7e36-497a-4299-9ae3-05ae6700f8a6', '2025-07-27 16:02:13', '2025-07-27 16:02:13', 59, 'Moderate'),
('ae72d7b0-aa84-4865-bc27-ac589d0d9ae1', 'If three 30 cm lengths of glass tubes are tightly packed with clay, sand, and loamy soils respectively and then stood in a beaker of water for one week, the level of water will be', 'MultipleChoice', '1', '[{\"file\": \"\", \"text\": \"Lowest in the tube with clay\", \"isCorrect\": true}, {\"file\": \"\", \"text\": \"The same in all tubes\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Lowest in the tube with loamy soil\", \"isCorrect\": false}, {\"file\": \"\", \"text\": \"Lowest in the tube with sandy soil\", \"isCorrect\": false}]', 'Lowest in the tube with clay', NULL, NULL, '34df7e36-497a-4299-9ae3-05ae6700f8a6', '2025-07-27 16:02:13', '2025-07-27 16:02:13', 60, 'Moderate'),
